from PySimpleGUI import PySimpleGUI as g

def title_bar(title, text_color, background_color):
        bc = background_color
        tc = text_color
        font = 'Helvetica 12'

        return [g.Col([[g.T(title, text_color=tc, background_color=bc, font=font, grab=True)]], pad=(0, 0), background_color=bc),
                g.Col([[g.T('_', text_color=tc, background_color=bc, enable_events=True, font=font, key='-MINIMIZE-'), g.Text('‚ùé', text_color=tc, background_color=bc, font=font, enable_events=True, key='Exit')]], element_justification='r', key='-C-', grab=True,
                    pad=(0, 0), background_color=bc)]

